// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
import React, { Component }  from 'react';
import {NavLink as RRNavLink} from 'react-router-dom';
import {
  Container,
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';

  import "../basics.css";
// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
class MainNavigator extends Component{
  constructor(props) {
  super(props);

  this.toggle = this.toggle.bind(this);
  this.state = {
    isOpen: true
  };
}
toggle() {
  this.setState({
    isOpen: !this.state.isOpen
  });
}
// ------------------ '(◣_◢)' ------------------
render() {
  return (
    <div className="black-back">
      <Container >
      <Navbar color="transparent" dark fluid expand="md">
        <NavbarBrand tag={RRNavLink} exact to="/" style={{color:"#f7f7f2", fontSize:"35px"}}>Gita</NavbarBrand>
        <NavbarToggler onClick={this.toggle} />
        <Collapse isOpen={!this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
            <NavItem>
              <NavLink tag={RRNavLink} exact to="/explorer" style={{color:"#ef8354",fontSize:"17px"}} activeStyle={{backgroundColor: '#2e2f31', textDecoration: 'none', outline:"none"}}>Explorer</NavLink>
            </NavItem>
            <NavItem>
              <NavLink tag={RRNavLink} exact to="/services" style={{color:"#f8f271", fontSize:"17px"}} activeStyle={{backgroundColor: '#2e2f31', textDecoration: 'none',outline:"none"}}>Services</NavLink>
            </NavItem>
            <NavItem>
              <NavLink tag={RRNavLink} exact to="/works" style={{color:"#4fb0c6",fontSize:"17px"}} activeStyle={{backgroundColor: '#2e2f31', textDecoration: 'none', outline:"none"}}>Works</NavLink>
            </NavItem>
            <NavItem>
              <NavLink tag={RRNavLink} exact to="/members" style={{color:"#f7f7f2",fontSize:"17px"}} activeStyle={{backgroundColor: '#2e2f31', textDecoration: 'none', outline:"none"}}>Members</NavLink>
            </NavItem>
        </Nav>
        </Collapse>
      </Navbar>
      </Container>
    </div>
  );
}
// ------------------ '(◣_◢)' ------------------

}
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------

// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------
export default MainNavigator;
